import React from 'react';

class Input extends React.Component {
  // Метод helloPrint
  helloPrint() {
    return console.log('hello! onClick');
  }

  onMouse() {
    return console.log('hello! onMouse');
  }

  // Переменная par
  par = 'priv how a u';

  // Метод render
  render() {
    return (
      <input 
        placeholder={this.par} 
        onClick={this.helloPrint.bind(this)} 
        onMouseEnter={this.onMouse.bind(this)}
      />
    );
  }
}

function EmmtyText() {
  return (<p>Привет это текст текст 2+1</p>);
}

class NewText extends React.Component {
  render() {
    return (<p>{this.props.title}</p>);
  }
}

function App() {
  return (
    <div className='App'>
      <Input />
      <EmmtyText />
      <EmmtyText />
      <EmmtyText />
      <NewText title='lol'/>
      <NewText title='хехе'/>
    </div>
  );
}

export default App;
